    false,nt"url": null,nt"notes": "Every year since 2007, all parents, all
    teachers, and students take the NYC School Survey. The survey ranks among the largest
    surveys of any kind ever conducted nationally. rnrnSurvey results provide insight
    into a school's learning environment and contribute a measure of diversification
    that goes beyond test scores on the Progress Report. Survey questions assess the
    community's opinions on academic expectations, communication, engagement, and safety
    and respect. School leaders can use survey results to better understand their own
    school's strengths and target areas for improvement. rnrnApproximately 600,000 New
    Yorkers participated in the survey in 2007. 216,914 parents, 31,592 teachers, and
    338,201 students submitted surveys and contributed feedback to their schools.",nt"license_title":
